module.exports = "<h4>Layouts</h4>\n\n<h5>Navigation layouts</h5>\n\nThe screen width must be wider than 1024px to see the header in any case.\n\n<h6>Navigation Layout with transparent header</h6>\n\n<div class=\"demo-container demo-layout-transparent\" mdl-shadow=\"2\">\n  <mdl-layout #mdlLayout1=\"mdlLayout\">\n    <mdl-layout-header mdl-layout-header-transparent>\n      <mdl-layout-header-row>\n        <mdl-layout-title>Title</mdl-layout-title>\n        <mdl-layout-spacer></mdl-layout-spacer>\n        <nav class=\"mdl-navigation\">\n          <a [routerLink]=\"['/layout/l1']\" class=\"mdl-navigation__link\">Link 1</a>\n          <a [routerLink]=\"['/layout/l2']\" class=\"mdl-navigation__link\">Link 2</a>\n          <a [routerLink]=\"['/layout/l3']\" class=\"mdl-navigation__link\">Link 3</a>\n        </nav>\n      </mdl-layout-header-row>\n    </mdl-layout-header>\n    <mdl-layout-drawer>\n      <mdl-layout-title>Title</mdl-layout-title>\n      <nav class=\"mdl-navigation\">\n        <a (click)=\"mdlLayout1.closeDrawer()\" [routerLink]=\"['/layout/l1']\" class=\"mdl-navigation__link\">Link 1</a>\n        <a (click)=\"mdlLayout1.closeDrawer()\" [routerLink]=\"['/layout/l2']\" class=\"mdl-navigation__link\">Link 2</a>\n        <a (click)=\"mdlLayout1.closeDrawer()\" [routerLink]=\"['/layout/l3']\" class=\"mdl-navigation__link\">Link 3</a>\n      </nav>\n    </mdl-layout-drawer>\n    <mdl-layout-content>\n      <router-outlet></router-outlet>\n    </mdl-layout-content>\n  </mdl-layout>\n</div>\n<br>\n<button (click)=\"mdlLayout1.toggleDrawer()\" mdl-button mdl-button-type=\"raised\" mdl-colored=\"primary\">Toggle Drawer\n</button>\n\n<pre demoPrism>\n  <![CDATA[\n  <div class=\"demo-container demo-layout-transparent\">\n    <mdl-layout #mdlLayout1=\"mdlLayout\">\n      <mdl-layout-header mdl-layout-header-transparent>\n        <mdl-layout-header-row>\n          <mdl-layout-title>Title</mdl-layout-title>\n          <mdl-layout-spacer></mdl-layout-spacer>\n          <nav class=\"mdl-navigation\">\n            <a [routerLink]=\"['/layout/l1']\" class=\"mdl-navigation__link\">Link 1</a>\n            <a [routerLink]=\"['/layout/l2']\" class=\"mdl-navigation__link\">Link 2</a>\n            <a [routerLink]=\"['/layout/l3']\" class=\"mdl-navigation__link\">Link 3</a>\n          </nav>\n        </mdl-layout-header-row>\n      </mdl-layout-header>\n      <mdl-layout-drawer>\n        <mdl-layout-title>Title</mdl-layout-title>\n        <nav class=\"mdl-navigation\">\n          <a (click)=\"mdlLayout1.closeDrawer()\" [routerLink]=\"['/layout/l1']\" class=\"mdl-navigation__link\">Link 1</a>\n          <a (click)=\"mdlLayout1.closeDrawer()\" [routerLink]=\"['/layout/l2']\" class=\"mdl-navigation__link\">Link 2</a>\n          <a (click)=\"mdlLayout1.closeDrawer()\" [routerLink]=\"['/layout/l3']\" class=\"mdl-navigation__link\">Link 3</a>\n        </nav>\n      </mdl-layout-drawer>\n      <mdl-layout-content>\n        <router-outlet></router-outlet>\n      </mdl-layout-content>\n    </mdl-layout>\n  </div>\n  <button (click)=\"mdlLayout1.toggleDrawer()\" mdl-button mdl-button-type=\"raised\" mdl-colored=\"primary\">Toggle Drawer\n  </button>\n  ]]>\n</pre>\n\n<h6>Fixed drawer, no header</h6>\n\n<div class=\"demo-container\" mdl-shadow=\"2\">\n  <mdl-layout mdl-layout-fixed-drawer>\n    <mdl-layout-drawer>\n      <mdl-layout-title>Title</mdl-layout-title>\n      <nav class=\"mdl-navigation\">\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n      </nav>\n    </mdl-layout-drawer>\n    <mdl-layout-content>\n      The content.\n    </mdl-layout-content>\n  </mdl-layout>\n</div>\n\n<pre demoPrism>\n  <![CDATA[\n  <div class=\"demo-container\" mdl-shadow=\"2\">\n    <mdl-layout mdl-layout-fixed-drawer>\n      <mdl-layout-drawer>\n        <mdl-layout-title>Title</mdl-layout-title>\n        <nav class=\"mdl-navigation\">\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n        </nav>\n      </mdl-layout-drawer>\n      <mdl-layout-content>\n        <!-- Your content goes here -->\n      </mdl-layout-content>\n    </mdl-layout>\n  </div>\n  ]]>\n</pre>\n\n<h6>Fixed header</h6>\n<p>Always shows a header, even in smaller screens.</p>\n<p>mdl-layout-header-seamed removes the shadow</p>\n\n<div class=\"demo-container\" mdl-shadow=\"2\">\n  <mdl-layout mdl-layout-fixed-header mdl-layout-header-seamed>\n    <mdl-layout-header>\n      <mdl-layout-header-row>\n        <mdl-layout-title>Title</mdl-layout-title>\n        <mdl-layout-spacer></mdl-layout-spacer>\n        <!-- Navigation. We hide it in small screens. -->\n        <nav class=\"mdl-navigation mdl-layout--large-screen-only\">\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n        </nav>\n      </mdl-layout-header-row>\n    </mdl-layout-header>\n    <mdl-layout-drawer>\n      <mdl-layout-title>Title</mdl-layout-title>\n      <nav class=\"mdl-navigation\">\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n      </nav>\n    </mdl-layout-drawer>\n    <mdl-layout-content>\n      <!-- Your content goes here -->\n    </mdl-layout-content>\n  </mdl-layout>\n</div>\n\n<pre demoPrism>\n  <![CDATA[\n  <div class=\"demo-container\" mdl-shadow=\"2\">\n    <mdl-layout mdl-layout-fixed-header mdl-layout-header-seamed>\n      <mdl-layout-header>\n        <mdl-layout-header-row>\n          <mdl-layout-title>Title</mdl-layout-title>\n          <mdl-layout-spacer></mdl-layout-spacer>\n          <!-- Navigation. We hide it in small screens. -->\n          <nav class=\"mdl-navigation mdl-layout--large-screen-only\">\n            <a class=\"mdl-navigation__link\">Link</a>\n            <a class=\"mdl-navigation__link\">Link</a>\n            <a class=\"mdl-navigation__link\">Link</a>\n          </nav>\n        </mdl-layout-header-row>\n      </mdl-layout-header>\n      <mdl-layout-drawer>\n        <mdl-layout-title>Title</mdl-layout-title>\n        <nav class=\"mdl-navigation\">\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n        </nav>\n      </mdl-layout-drawer>\n      <mdl-layout-content>\n        <!-- Your content goes here -->\n      </mdl-layout-content>\n    </mdl-layout>\n  </div>\n  ]]>\n</pre>\n\n<h6>Fixed header and drawer</h6>\n<p>The drawer is always open in large screens. The header is always shown, even in small screens.</p>\n\n<div class=\"demo-container\" mdl-shadow=\"2\">\n  <mdl-layout mdl-layout-fixed-drawer mdl-layout-fixed-header>\n    <mdl-layout-header>\n      <mdl-layout-header-row>\n        <mdl-layout-title>Title</mdl-layout-title>\n        <mdl-layout-spacer></mdl-layout-spacer>\n        <!-- Navigation. We hide it in small screens. -->\n        <nav class=\"mdl-navigation mdl-layout--large-screen-only\">\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n        </nav>\n      </mdl-layout-header-row>\n    </mdl-layout-header>\n    <mdl-layout-drawer>\n      <mdl-layout-title>Title</mdl-layout-title>\n      <nav class=\"mdl-navigation\">\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n      </nav>\n    </mdl-layout-drawer>\n    <mdl-layout-content>\n      <!-- Your content goes here -->\n    </mdl-layout-content>\n  </mdl-layout>\n</div>\n\n<pre demoPrism>\n  <![CDATA[\n  <mdl-layout mdl-layout-fixed-drawer mdl-layout-fixed-header>\n    ...\n  </mdl-layout>\n  ]]>\n</pre>\n\n<h6>Scrolling header</h6>\n<p>Uses a header that scrolls with the text, rather than staying locked at the top</p>\n\n<div class=\"demo-container\" mdl-shadow=\"2\">\n  <mdl-layout mdl-layout-mode=\"scroll\">\n    <mdl-layout-header>\n      <mdl-layout-header-row>\n        <mdl-layout-title>Title</mdl-layout-title>\n        <mdl-layout-spacer></mdl-layout-spacer>\n        <nav class=\"mdl-navigation\">\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n        </nav>\n      </mdl-layout-header-row>\n    </mdl-layout-header>\n    <mdl-layout-drawer>\n      <mdl-layout-title>Title</mdl-layout-title>\n      <nav class=\"mdl-navigation\">\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n      </nav>\n    </mdl-layout-drawer>\n    <mdl-layout-content>\n      <div class=\"page-content\"><!-- Your content goes here --></div>\n    </mdl-layout-content>\n  </mdl-layout>\n</div>\n\n<pre demoPrism>\n  <![CDATA[\n  <mdl-layout mdl-layout-mode=\"scroll\">\n    ...\n  </mdl-layout>\n  ]]>\n</pre>\n\n<h6>Waterfall header</h6>\n<p>Uses a header that contracts as the page scrolls down.</p>\n\n<div class=\"demo-container\" mdl-shadow=\"2\">\n  <mdl-layout mdl-layout-mode=\"waterfall\">\n    <mdl-layout-header>\n      <!-- Top row, always visible -->\n      <mdl-layout-header-row>\n        <!-- Title -->\n        <mdl-layout-title>Title</mdl-layout-title>\n        <mdl-layout-spacer></mdl-layout-spacer>\n        <mdl-textfield icon=\"search\" type=\"text\"></mdl-textfield>\n      </mdl-layout-header-row>\n      <!-- Bottom row, not visible on scroll -->\n      <mdl-layout-header-row>\n        <mdl-layout-spacer></mdl-layout-spacer>\n        <!-- Navigation -->\n        <nav class=\"mdl-navigation\">\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n          <a class=\"mdl-navigation__link\">Link</a>\n        </nav>\n      </mdl-layout-header-row>\n    </mdl-layout-header>\n    <mdl-layout-drawer>\n      <mdl-layout-title>Title</mdl-layout-title>\n      <nav class=\"mdl-navigation\">\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n        <a class=\"mdl-navigation__link\">Link</a>\n      </nav>\n    </mdl-layout-drawer>\n    <mdl-layout-content>\n      <div class=\"page-content\"><!-- Your content goes here --></div>\n    </mdl-layout-content>\n  </mdl-layout>\n</div>\n\n<pre demoPrism>\n  <![CDATA[\n  <mdl-layout mdl-layout-mode=\"waterfall\">\n    ...\n  </mdl-layout>\n  ]]>\n</pre>\n\n<h6>Fixed tabs</h6>\n\n<div class=\"demo-container\" mdl-shadow=\"2\">\n  <mdl-layout (mdl-layout-tab-active-changed)=\"tabChanged($event)\"\n    (mdl-layout-tab-mouseout)=\"tabMouseout($event)\"\n    (mdl-layout-tab-mouseover)=\"tabMouseover($event)\"\n    [mdl-layout-tab-active-index]=\"activeIndex\"\n    mdl-layout-fixed-header>\n    <mdl-layout-header>\n      <mdl-layout-header-row>\n        <mdl-layout-title>Title</mdl-layout-title>\n      </mdl-layout-header-row>\n    </mdl-layout-header>\n    <mdl-layout-drawer>\n      <mdl-layout-title>Title</mdl-layout-title>\n    </mdl-layout-drawer>\n    <mdl-layout-content>\n      <mdl-layout-tab-panel>\n        <mdl-tab-panel-title>\n          <mdl-icon class=\"mdl-color-text--accent\">person</mdl-icon>\n          <span>Tab 1</span>\n        </mdl-tab-panel-title>\n        <mdl-tab-panel-content>\n          1\n        </mdl-tab-panel-content>\n      </mdl-layout-tab-panel>\n      <mdl-layout-tab-panel mdl-layout-tab-panel-title=\"Tab 2\">\n        2\n      </mdl-layout-tab-panel>\n      <mdl-layout-tab-panel mdl-layout-tab-panel-title=\"Tab 3\">\n        3\n      </mdl-layout-tab-panel>\n    </mdl-layout-content>\n  </mdl-layout>\n</div>\n\nactive index:\n<input [(ngModel)]=\"activeIndex\" max=\"2\" min=\"0\" type=\"number\">\n\n<pre demoPrism>\n  <![CDATA[\n  <div class=\"demo-container\" mdl-shadow=\"2\">\n    <mdl-layout (mdl-layout-tab-active-changed)=\"tabChanged($event)\"\n      mdl-layout-fixed-header mdl-layout-tab-active-index=\"0\">\n      <mdl-layout-header>\n        <mdl-layout-header-row>\n          <mdl-layout-title>Title</mdl-layout-title>\n        </mdl-layout-header-row>\n      </mdl-layout-header>\n      <mdl-layout-drawer>\n        <mdl-layout-title>Title</mdl-layout-title>\n      </mdl-layout-drawer>\n      <mdl-layout-content>\n        <mdl-layout-tab-panel>\n          <mdl-tab-panel-title>\n            <mdl-icon class=\"mdl-color-text--primary\">person</mdl-icon>\n            <span>Tab 1</span>\n          </mdl-tab-panel-title>\n          <mdl-tab-panel-content>\n            1\n          </mdl-tab-panel-content>\n        </mdl-layout-tab-panel>\n        <mdl-layout-tab-panel mdl-layout-tab-panel-title=\"Tab 2\">\n          2\n        </mdl-layout-tab-panel>\n        <mdl-layout-tab-panel mdl-layout-tab-panel-title=\"Tab 3\">\n          3\n        </mdl-layout-tab-panel>\n      </mdl-layout-content>\n    </mdl-layout>\n  </div>\n  ]]>\n</pre>\n\n<h5>Grid</h5>\n\nPlease visit the original\n<a href=\"https://getmdl.io/components/index.html#layout-section/grid\" target=\"mdl-docu\">material lite documentation\n</a> how to use the grid system.\n\n\n<h5>Footer</h5>\n\nPlease visit the original\n<a href=\"https://getmdl.io/components/index.html#layout-section/footer\" target=\"mdl-docu\">material lite documentation\n</a> how to create footers.\n\n\n<h4>Layout-Components</h4>\n<table class=\"docu\" mdl-shadow=\"2\">\n  <thead>\n    <tr>\n      <th>Component</th>\n      <th>Description</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td>\n        mdl-layout\n      </td>\n      <td>\n        Parent component for a mdl layout. Needs the child components\n        <i>mdl-layout-header</i>\n        (optional),\n        <i>mdl-layout-drawer</i>\n        (optional) and mdl-layout-content.\n        <br/>\n        The layout is exportted as mdlLayout in the view. The methods\n        <i>toggleDrawer</i>\n        and\n        <i>closeDrawer</i>\n        are exported.\n      </td>\n    </tr>\n\n    <tr>\n      <td>mdl-layout-drawer</td>\n      <td>The drawer of the layout. If present a button that toggles the drawer is automatically created.</td>\n    </tr>\n\n    <tr>\n      <td>mdl-layout-header</td>\n      <td>The header component of a layout. May contain multiple\n        <i>mdl-layout-header-row</i>\n        directives.\n      </td>\n    </tr>\n\n    <tr>\n      <td>mdl-layout-header-row</td>\n      <td></td>\n    </tr>\n\n    <tr>\n      <td>mdl-layout-spacer</td>\n      <td>Components that creates a spacer - e.g. a flex-grow:1 div to occupy much space as possible between\n        components.\n      </td>\n    </tr>\n\n    <tr>\n      <td>mdl-layout-tab-panel</td>\n      <td>A component within the\n        <i>mdl.layout-content</i>\n        that will be used as the tab content.\n        The tabs are created automatically and are placed in the provided<i>mdl-layout-header</i>.\n      </td>\n    </tr>\n\n    <tr>\n      <td>mdl-layout-title</td>\n      <td>Component that specifies the title with a<i>mdl-layout-header-row</i>.\n      </td>\n    </tr>\n\n  </tbody>\n</table>\n\n<h5>Layout-Component Attributes</h5>\n<table class=\"docu\" mdl-shadow=\"2\">\n  <thead>\n    <tr>\n      <th>Attribute</th>\n      <th>Description</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td>\n        mdl-layout-mode\n      </td>\n      <td>\n        The following modes are supported\n        <ul>\n          <li>\n            <i>standard</i>\n            no special handling for the header.\n          </li>\n          <li>\n            <i>waterfall</i>\n            If the content scrolls the header will be reduced to one row\n            if the header consists of multiple header rows.\n          </li>\n          <li>\n            <i>scroll</i>\n            The header scrolls with the content. e.g. is not fixed to the top.\n          </li>\n        </ul>\n      </td>\n    </tr>\n    <tr>\n      <td>mdl-layout-fixed-drawer</td>\n      <td>\n        The drawer is fixed - e.g. is always open\n      </td>\n    </tr>\n    <tr>\n      <td>mdl-layout-fixed-header</td>\n      <td>The header is fixed - e.g. is always visible even on small screens (less than 1024px width)</td>\n    </tr>\n    <tr>\n      <td>mdl-layout-header-seamed</td>\n      <td>The header has a drop shadow</td>\n    </tr>\n    <tr>\n      <td>mdl-layout-no-drawer-button</td>\n      <td>If the layout contains a\n        <i>mdl-layout-drawer</i>\n        a button is rendered at the header to toggle the drawer.\n        If\n        <i>mdl-layout-no-drawer-button</i>\n        is present this button will not be drawn to the view.\n      </td>\n    </tr>\n\n    <tr>\n      <td>mdl-layout-tab-active-changed</td>\n      <td>Event-listener function that will be fired if the activ tab index changed. The changed index\n        is stored in the\n        <i>index</i>\n        property of the event object.\n      </td>\n    </tr>\n    <tr>\n      <td>mdl-layout-tab-active-index</td>\n      <td>Secifies the index of the active tab. Needs\n        <i>mdl-layout-tab-panel</i>\n        components within the<i>mdl-layout-content</i>.\n      </td>\n    </tr>\n\n    <tr>\n      <td>mdl-layout-tab-mouseout</td>\n      <td>Event-listener function that will be fired if the mouse is over a tab. The index\n        is stored in the\n        <i>index</i>\n        property of the event object.\n      </td>\n    </tr>\n\n    <tr>\n      <td>mdl-layout-tab-mouseover</td>\n      <td>Event-listener function that will be fired if the mouse is out of a tab. The index\n        is stored in the\n        <i>index</i>\n        property of the event object.\n      </td>\n    </tr>\n\n    <tr>\n      <td>mdl-ripple</td>\n      <td>BooleanProperty. If present or true the tabs will ripple on click or tap.</td>\n    </tr>\n\n  </tbody>\n</table>\n\n\n<h5>Layout-Header-Component Attributes</h5>\n\n<table class=\"docu\" mdl-shadow=\"2\">\n  <thead>\n    <tr>\n      <th>Attribute</th>\n      <th>Description</th>\n    </tr>\n  </thead>\n  <tbody>\n\n    <tr>\n      <td>mdl-layout-header-transparent</td>\n      <td>\n        Creates a header with no background color.\n      </td>\n    </tr>\n\n  </tbody>\n</table>\n\n\n<h5>Layout-Tab-Panel-Component Attributes</h5>\n\n<table class=\"docu\" mdl-shadow=\"2\">\n  <thead>\n    <tr>\n      <th>Attribute</th>\n      <th>Description</th>\n    </tr>\n  </thead>\n  <tbody>\n\n    <tr>\n      <td>mdl-layout-tab-panel-title</td>\n      <td>\n        The content of this attribute is used to create the tab title.\n      </td>\n    </tr>\n\n  </tbody>\n</table>\n\n\n\n"

