module.exports = "<h4>Snackbar </h4>\n\n<h5>Prerequisites</h5>\n<p>\n  Every Snackbar needs a place to be attached to the dom. The easiest way to achieve this is a dialog-outlet html\n  element within your body element:\n</p>\n<pre demoPrism ngNonBindable>\n  <![CDATA[\n<html>\n  <head>...</head>\n  <body>\n    <app-root>...</app-root>\n    <dialog-outlet></dialog-outlet>\n  </body>\n</html>\n]]>\n</pre>\n<p>It is no problem, that this component is outside of your root app-component!</p>\n\n<button (click)=\"showSnackbar()\" mdl-button mdl-button-type=\"raised\" mdl-colored=\"primary\" mdl-ripple>Show Snackbar\n</button>\n\n\n<pre demoPrism>\n  <![CDATA[\n\n  <button (click)=\"showSnackbar()\" mdl-button mdl-button-type=\"raised\" mdl-colored=\"primary\"\n          mdl-ripple>Show Snackbar</button>\n\n  <scriptx>\n  export class SnackbarDemo {\n\n    constructor(private mdlSnackbarService: MdlSnackbarService) {}\n\n    showSnackbar() {\n      this.mdlSnackbarService.showSnackbar({\n    message:'The Message',\n    action:{\n          handler:()=>{\n    this.mdlSnackbarService.showToast('You hit the ok Button');\n          },\n          text: 'OK'\n        }\n      });\n    }\n  }\n  </scriptx>\n]]>\n</pre>\n\n\n<h6>Methods</h6>\n<table class=\"docu\" mdl-shadow=\"2\">\n  <thead>\n  <tr>\n    <th>Method</th>\n    <th>Description</th>\n  </tr>\n  </thead>\n  <tbody>\n\n  <tr>\n    <td>showToast(<br/>\n      message: string,<br/>\n      timeout?: number)<br/>\n      : Promise&lt;MdlSnackbarComponent&gt;\n    </td>\n    <td>\n      Shorthand version for\n      <pre>\nreturn this.showSnackbar(&#123;\n   message: message,\n   timeout?: timeout\n &#125;);\n         </pre>\n      Shows an auto hiding text.\n    </td>\n  </tr>\n\n  <tr>\n    <td>showSnackbar(<br/>\n      snackbarMessage: IMdlSnackbarMessage)<br/>\n      : Promise&lt;MdlSnackbarComponent&gt;\n    </td>\n    <td>\n      Shows a snackbar. The <i>IMdlSnackbarMessage</i> is:\n      <pre>\n  &#123;message: string;\n  timeout?: number;\n  action?:&#123;\n    handler: () => void;\n    text: string;&#125;\n\n         </pre>\n      <pre>message</pre>\n      The message that should be shown.\n      <pre>timeout</pre>\n      for how long should the message be visible. Defaults to 2750 ms. Is ignored if an action is proivded.\n      <pre>action</pre>\n      Consists of a handler fuction and an aciton text. The text will be the buttons label. The action is called if the\n      button is clicked.\n      <p>\n        Returns a Promis with the created <i>MdlSnackbarComponent</i>. You can use this instance to\n        manipulate the <i>MdlSnackbarComponent</i> and be informed if the Snackbar is shown to the user.\n      </p>\n    </td>\n  </tr>\n  </tbody>\n</table>\n"

