module.exports = "<h4>Text Fields</h4>\n\n\n<mdl-textfield\n  #theFirstTextfield\n  (blur)=\"onBlur($event)\"\n  (focus)=\"onFocus($event)\"\n  (keyup)=\"onKeyup($event)\"\n  [(ngModel)]=\"text1\"\n  autocomplete=\"name\"\n  autofocus\n  label=\"Text...\"\n  placeholder=\"type a text\"\n  type=\"text\"></mdl-textfield>\n<mdl-textfield\n  [(ngModel)]=\"text2\"\n  error-msg=\"Input is not a number!\"\n  label=\"Number...\"\n  pattern=\"-?[0-9]*(\\.[0-9]+)?\"\n  type=\"text\"></mdl-textfield>\n\n<br/>\n{{text1}}\n{{text2}}\n\n<br/>\n<mdl-textfield [(ngModel)]=\"text3\" disabled label=\"Text...(disabled)\" type=\"text\"></mdl-textfield>\n\n<br/>\n<mdl-textfield [(ngModel)]=\"text3\" label=\"Text...(required)\" required=\"\" type=\"text\"></mdl-textfield>\n\n<pre demoPrism>\n  <![CDATA[\n<mdl-textfield\n  (blur)=\"onBlur($event)\"\n  (focus)=\"onFocus($event)\"\n  (keyup)=\"onKeyup($event)\"\n  [(ngModel)]=\"text1\"\n  autocomplete=\"name\"\n  autofocus\n  label=\"Text...\"\n  placeholder=\"type a text\"\n  type=\"text\"></mdl-textfield>\n\n<mdl-textfield\n  [(ngModel)]=\"text2\"\n  error-msg=\"Input is not a number!\"\n  label=\"Number...\"\n  pattern=\"-?[0-9]*(\\.[0-9]+)?\"\n  type=\"text\"></mdl-textfield>\n  ]]>\n</pre>\n\n<h5>Set max length</h5>\n\n<mdl-textfield label=\"maxlength is 10\" maxlength=\"10\" type=\"text\"></mdl-textfield>\n\n<pre demoPrism>\n  <![CDATA[\n<mdl-textfield label=\"maxlength is 10\" maxlength=\"10\" type=\"text\"></mdl-textfield>\n  ]]>\n</pre>\n\n<h5>Text/Numeric with floating label</h5>\n\n<mdl-textfield [(ngModel)]=\"text3\" floating-label label=\"Text...\" name=\"text1\" type=\"text\"></mdl-textfield>\n<mdl-textfield\n  [(ngModel)]=\"text4\"\n  error-msg=\"Input is not a number!\"\n  floating-label\n  label=\"Number...\"\n  name=\"text2\"\n  pattern=\"-?[0-9]*(\\.[0-9]+)?\"\n  type=\"text\"></mdl-textfield>\n\n<br/>\n{{text3}}\n{{text4}}\n\n<pre demoPrism>\n  <![CDATA[\n<mdl-textfield [(ngModel)]=\"text3\" floating-label label=\"Text...\" type=\"text\"></mdl-textfield>\n<mdl-textfield\n  [(ngModel)]=\"text4\"\n  error-msg=\"Input is not a number!\"\n  floating-label\n  label=\"Number...\"\n  pattern=\"-?[0-9]*(\\.[0-9]+)?\"\n  type=\"text\"></mdl-textfield>\n  ]]>\n</pre>\n\n<h5>Number with min and step restrictions</h5>\n\n<mdl-textfield\n  [(ngModel)]=\"number1\"\n  error-msg=\"invalid number!\"\n  floating-label\n  label=\"Number...\"\n  min=\"0\"\n  name=\"number1\"\n  step=\"0.01\"\n  type=\"number\"></mdl-textfield>\n\n<br/>\n{{number1}}\n{{valueType}}\n\n<pre demoPrism>\n  <![CDATA[\n<mdl-textfield\n  [(ngModel)]=\"number1\"\n  error-msg=\"Input is not a number!\"\n  floating-label\n  label=\"Number...\"\n  min=\"0\"\n  name=\"number1\"\n  step=\"0.01\"\n  type=\"number\"></mdl-textfield>\n  ]]>\n</pre>\n\n<h5>Multiline Textfield</h5>\naka Textarea. Add the attribute row to turn the input field to a textarea. Specify maxrows to restrict the\npossible lines.<br/>\n\n<mdl-textfield [(ngModel)]=\"text5\" floating-label label=\"Text...\" maxrows=\"3\" rows=\"3\"></mdl-textfield>\n<br/>\n{{text5}}\n\n<pre demoPrism>\n  <![CDATA[\n<mdl-textfield [(ngModel)]=\"text5\" floating-label label=\"Text...\" maxrows=\"3\" rows=\"3\"></mdl-textfield>\n  ]]>\n</pre>\n\n<h5>Expandable</h5>\n\nJust specify an icon to turn the text input field into an expandable field.\n<br/>\n\n<mdl-textfield [(ngModel)]=\"text6\" icon=\"search\" type=\"text\"></mdl-textfield>\n<br/>\n{{text6}}\n<pre demoPrism>\n  <![CDATA[\n<mdl-textfield [(ngModel)]=\"text6\" icon=\"search\" type=\"text\"></mdl-textfield>\n  ]]>\n</pre>\n\n<h5>Attributes of the mdl-textfield component</h5>\n<table class=\"docu\" mdl-shadow=\"2\">\n  <thead>\n  <tr>\n    <th>Attribute</th>\n    <th>Description</th>\n  </tr>\n  </thead>\n  <tbody>\n\n  <tr>\n    <td>autofocus</td>\n    <td>Set the focus on this input field on page load.</td>\n  </tr>\n\n  <tr>\n    <td>disableNativeValidityChecking</td>\n    <td>Is a BooleanProperty that disables the build in native checking to mark the input\n      field as invalid.\n      See <a href=\"https://github.com/mseemann/angular2-mdl/wiki/Mdl-Textfield-and-native-validity-checking\"\n             target=\"_blank\">\n        https://github.com/mseemann/angular2-mdl/wiki/Mdl-Textfield-and-native-validity-checking\n      </a>for a detailed description.\n    </td>\n  </tr>\n\n  <tr>\n    <td>disabled</td>\n    <td>Disable the text field if present or true.</td>\n  </tr>\n\n\n  <tr>\n    <td>error-msg</td>\n    <td>The error message that will be shown if the input value did not match the pattern.</td>\n  </tr>\n\n  <tr>\n    <td>floating-label</td>\n    <td>If present or true the label of the text field will be floating if the element has the focus.</td>\n  </tr>\n\n  <tr>\n    <td>icon</td>\n    <td>If present the input field is hidden until the icon is clicked or the\n      component gains the focus. The icon must be a material design icon.\n    </td>\n  </tr>\n\n  <tr>\n    <td>label</td>\n    <td>The label of the input field</td>\n  </tr>\n\n  <tr>\n    <td>max</td>\n    <td>Restrict the value for type number to a max value.</td>\n  </tr>\n\n  <tr>\n    <td>maxrows</td>\n    <td>Defines the maximum number of row the component will expand to.</td>\n  </tr>\n\n  <tr>\n    <td>min</td>\n    <td>Restrict the value for type number to a min value.</td>\n  </tr>\n\n  <tr>\n    <td>step</td>\n    <td>Restrict the value for type number to a be based on the given step (e.g. 0.01\n      for numbers with two decimal places).\n    </td>\n  </tr>\n\n  <tr>\n    <td>ngModel</td>\n    <td>The text field is ngModel compatible.</td>\n  </tr>\n\n  <tr>\n    <td>pattern</td>\n    <td>A regular expression that the input text must conform to. If it dosen't match\n      the error (attribute <i>error-msg</i>) will be shown\n    </td>\n  </tr>\n\n  <tr>\n    <td>placeholder</td>\n    <td>A placeholder string for the input filed.</td>\n  </tr>\n\n  <tr>\n    <td>readonly</td>\n    <td>Mark the text field as readonly.</td>\n  </tr>\n\n  <tr>\n    <td>required</td>\n    <td>Mark the text field as required.</td>\n  </tr>\n\n  <tr>\n    <td>rows</td>\n    <td>If present the input field will be drawn as textarea. You can specify the number of rows.</td>\n  </tr>\n\n  <tr>\n    <td>type</td>\n    <td>\n      The type of the input field - propaget to the underlying <i>input</i> element.\n    </td>\n  </tr>\n\n  <tr>\n    <td>maxlength</td>\n    <td>The max. length for the input field.</td>\n  </tr>\n\n  <tr>\n    <td>(blur)</td>\n    <td>The event fires if the input element is loosing the focus.</td>\n  </tr>\n\n  <tr>\n    <td>(focus)</td>\n    <td>The event fires if the input element is getting the focus.</td>\n  </tr>\n\n\n  </tbody>\n</table>\n"

