module.exports = "<h4>The Toggles </h4>\n\n<h5>Checkbox</h5>\n\n<mdl-checkbox (change)=\"onChange($event)\" [(ngModel)]=\"checkbox1\" [mdl-ripple]=\"true\">\n  Checkbox\n</mdl-checkbox>\n{{checkbox1}}\n\n<mdl-checkbox (change)=\"onChange($event)\" [(ngModel)]=\"checkbox1\" [disabled]=\"true\" [mdl-ripple]=\"true\">\n  Checkbox Disabled\n</mdl-checkbox>\n\n<pre demoPrism ngNonBindable>\n  <![CDATA[\n  <mdl-checkbox [(ngModel)]=\"checkbox1\" [mdl-ripple]=\"true\">\n    Checkbox\n  </mdl-checkbox>\n  {{checkbox1}}\n  ]]>\n</pre>\n\n<mdl-checkbox [(ngModel)]=\"checkbox2\">\n  Checkbox\n</mdl-checkbox>\n{{checkbox2}}\n<pre demoPrism ngNonBindable>\n  <![CDATA[\n  <mdl-checkbox [(ngModel)]=\"checkbox2\">\n    Checkbox\n  </mdl-checkbox>\n  {{checkbox2}}\n  ]]>\n</pre>\n\n<p>The <i>mdl-checkbox</i> is <i>ngModel</i> compliant. You can provide the <i>mdl-ripple</i> directive to create a\n  ripple effect.</p>\n\n\n<h5>Radios</h5>\n<mdl-radio (change)=\"onChange($event)\" [(ngModel)]=\"radioOption\" mdl-ripple name=\"group1\" value=\"1\">Value 1</mdl-radio>\n<mdl-radio (change)=\"onChange($event)\" [(ngModel)]=\"radioOption\" mdl-ripple name=\"group1\" value=\"2\">Value 2</mdl-radio>\n<mdl-radio (change)=\"onChange($event)\" [(ngModel)]=\"radioOption\" [disabled]=\"true\" mdl-ripple name=\"group1\" value=\"3\">\n  Value 3 (disabled)\n</mdl-radio>\n\n{{radioOption}}\n\n<pre demoPrism ngNonBindable>\n  <![CDATA[\n  <mdl-radio [(ngModel)]=\"radioOption\" mdl-ripple name=\"group1\" value=\"1\">Value 1</mdl-radio>\n  <mdl-radio [(ngModel)]=\"radioOption\" mdl-ripple name=\"group1\" value=\"2\">Value 2</mdl-radio>\n  <mdl-radio [(ngModel)]=\"radioOption\" [disabled]=\"true\" mdl-ripple name=\"group1\"\n             value=\"3\">Value 3 (disabled)</mdl-radio>\n\n  {{radioOption}}\n  ]]>\n</pre>\n\n<p>The <i>mdl-radio</i> component is <i>ngModel</i> compliant.\n  The <i>name</i> attribute is used to group radios together. You need to provide a\n  name or a formControlName. If you provide both they must be the same. All radiobutton\n  groups must have a unique name.\n  The <i>value</i> is used to set the <i>ngModel</i> value if the option is selected.\n  You can provide the <i>mdl-ripple</i> directive to create a ripple effect.\n</p>\n\n<h5>Icon Toggle</h5>\n\n<mdl-icon-toggle (change)=\"onChange($event)\" [(ngModel)]=\"checkbox1\" mdl-ripple>format_bold</mdl-icon-toggle>\n{{checkbox1}}\n<mdl-icon-toggle [(ngModel)]=\"checkbox2\">format_italic</mdl-icon-toggle>\n{{checkbox2}}\n<mdl-icon-toggle [(ngModel)]=\"checkbox2\" [disabled]=\"true\">format_italic</mdl-icon-toggle>\n(disabled) {{checkbox2}}\n\n<pre demoPrism ngNonBindable>\n  <![CDATA[\n  <mdl-icon-toggle [(ngModel)]=\"checkbox1\">format_bold</mdl-icon-toggle>\n  {{checkbox1}}\n  <mdl-icon-toggle [(ngModel)]=\"checkbox2\">format_italic</mdl-icon-toggle>\n  {{checkbox2}}\n  <mdl-icon-toggle [(ngModel)]=\"checkbox2\" [disabled]=\"true\">format_italic</mdl-icon-toggle>\n  (disabled) {{checkbox2}}\n  ]]>\n</pre>\n\n<p>The <i>mdl-icon-toggle</i> is much like a <i>mdl-checkbox</i> componnet.\n  The only difference: an colored icon is used to cover the state of the checkbox.</p>\n\n<h5>Switch</h5>\n\n<mdl-switch (change)=\"onChange($event)\" [(ngModel)]=\"checkbox1\" mdl-ripple>Option 1</mdl-switch>\n{{checkbox1}}\n<mdl-switch [(ngModel)]=\"checkbox2\">Option 2</mdl-switch>\n{{checkbox2}}\n<mdl-switch [(ngModel)]=\"checkbox2\" [disabled]=\"true\">Option 3 (disabled)</mdl-switch>\n{{checkbox2}}\n\n<pre demoPrism ngNonBindable>\n  <![CDATA[\n  <mdl-switch [(ngModel)]=\"checkbox1\" mdl-ripple>Option 1</mdl-switch>\n  {{checkbox1}}\n  <mdl-switch [(ngModel)]=\"checkbox2\">Option 2</mdl-switch>\n  {{checkbox2}}\n  <mdl-switch [(ngModel)]=\"checkbox2\" [disabled]=\"true\">Option 3 (disabled)</mdl-switch>\n  {{checkbox2}}\n  ]]>\n</pre>\n\n<p>The <i>mdl-switch</i> is much like an <i>mdl-checkbox</i> componnet.\n  The only difference: an toggle ui is used to cover the state of the checkbox.</p>\n"

